import Header from '../components/header.js';
import Footer from '../components/footer.js';

function Politica(){
    return(
        <>
        <Header />
        <div className='w-full h-[400px]'>
            <div className='bg-[#96ABAC] h-[300px] w-[950px] rounded'></div>
        </div>
        <Footer />
        </>
    );
}

export default Politica;
